"title" varchar(255) COLLATE "default" NOT NULL,
"alias" varchar(255) COLLATE "default" NOT NULL,
"note" varchar(255) COLLATE "default" DEFAULT ''::character varying NOT NULL,
"path" varchar(1024) COLLATE "default" DEFAULT ''::character varying NOT NULL,
"link" varchar(1024) COLLATE "default" NOT NULL,
"type" varchar(16) COLLATE "default" NOT NULL,
