"checked_out_time" timestamp(6) DEFAULT '1970-01-01 00:00:00'::timestamp without time zone NOT NULL,
"browserNav" int2 DEFAULT 0 NOT NULL,
"access" int8 DEFAULT 0 NOT NULL,
"img" varchar(255) COLLATE "default" DEFAULT ''::character varying NOT NULL,
"template_style_id" int4 DEFAULT 0 NOT NULL,
"params" text COLLATE "default" DEFAULT ''::text NOT NULL,
"lft" int8 DEFAULT 0 NOT NULL,
"rgt" int8 DEFAULT 0 NOT NULL,
"home" int2 DEFAULT 0 NOT NULL,
"language" varchar(7) COLLATE "default" DEFAULT ''::character varying NOT NULL,
"client_id" int2 DEFAULT 0 NOT NULL
)
