COMMENT ON COLUMN "public"."ihzns_menu"."menutype" IS 'The type of menu this item belongs to. FK to #__menu_types.menutype';
COMMENT ON COLUMN "public"."ihzns_menu"."title" IS 'The display title of the menu item.';
COMMENT ON COLUMN "public"."ihzns_menu"."alias" IS 'The SEF alias of the menu item.';
COMMENT ON COLUMN "public"."ihzns_menu"."path" IS 'The computed path of the menu item based on the alias field.';
COMMENT ON COLUMN "public"."ihzns_menu"."link" IS 'The actually link the menu item refers to.';
COMMENT ON COLUMN "public"."ihzns_menu"."type" IS 'The type of link: Component, URL, Alias, Separator';
COMMENT ON COLUMN "public"."ihzns_menu"."published" IS 'The published state of the menu link.';
COMMENT ON COLUMN "public"."ihzns_menu"."parent_id" IS 'The parent menu item in the menu tree.';
COMMENT ON COLUMN "public"."ihzns_menu"."level" IS 'The relative level in the tree.';
COMMENT ON COLUMN "public"."ihzns_menu"."component_id" IS 'FK to #__extensions.id';
COMMENT ON COLUMN "public"."ihzns_menu"."checked_out" IS 'FK to #__users.id';
COMMENT ON COLUMN "public"."ihzns_menu"."checked_out_time" IS 'The time the menu item was checked out.';
COMMENT ON COLUMN "public"."ihzns_menu"."browserNav" IS 'The click behaviour of the link.';
COMMENT ON COLUMN "public"."ihzns_menu"."access" IS 'The access level required to view the menu item.';
COMMENT ON COLUMN "public"."ihzns_menu"."img" IS 'The image of the menu item.';
COMMENT ON COLUMN "public"."ihzns_menu"."params" IS 'JSON encoded data for the menu item.';
COMMENT ON COLUMN "public"."ihzns_menu"."lft" IS 'Nested set lft.';
COMMENT ON COLUMN "public"."ihzns_menu"."rgt" IS 'Nested set rgt.';
COMMENT ON COLUMN "public"."ihzns_menu"."home" IS 'Indicates if this menu item is the home or default page.';

