SELECT ihzns_publicidad.id_publicidad, ihzns_publicidad.id_user, ihzns_publicidad.fecha, ihzns_publicidad.leido, ihzns_publicidad.asunto, ihzns_publicidad.estado, ihzns_publicidad.descripcion, ihzns_publicidad.id_persona, ihzns_publicidad.fecha_modificacion, ihzns_publicidad.descripcion_asig_publicidad FROM ihzns_publicidad WHERE (ihzns_publicidad.estado <> 0);

-- ----------------------------
-- View structure for publicidad_sin_procesar
-- ----------------------------
CREATE OR REPLACE VIEW "public"."publicidad_sin_procesar" AS 
SELECT ihzns_publicidad.id_user, ihzns_publicidad.id_publicidad, ihzns_publicidad.asunto, ihzns_publicidad.fecha FROM ihzns_publicidad WHERE (ihzns_publicidad.estado = 0);

-- ----------------------------
-- View structure for solicitud_negocio_procesadas
-- ----------------------------
CREATE OR REPLACE VIEW "public"."solicitud_negocio_procesadas" AS 
SELECT ihzns_solicitud.asunto, ihzns_solicitud.fecha, ihzns_solicitud.id_usuario, ihzns_solicitud.estado, ihzns_solicitud.id_solicitud, ihzns_solicitud.descripcion, ihzns_solicitud.nombre_negocio, ihzns_solicitud.direccion_negocio, ihzns_solicitud.resenya_negocio, ihzns_solicitud.foto, ihzns_solicitud.correo, ihzns_solicitud.url, ihzns_solicitud.telefono_fijo, ihzns_solicitud.otro_telefono, ihzns_solicitud.foto_1, ihzns_solicitud.foto_2, ihzns_solicitud.categoria FROM ihzns_solicitud WHERE (ihzns_solicitud.estado <> 0);

-- ----------------------------
-- View structure for solicitud_negocio_sin_procesar
-- ----------------------------
CREATE OR REPLACE VIEW "public"."solicitud_negocio_sin_procesar" AS 
SELECT ihzns_solicitud.id_usuario, ihzns_solicitud.asunto, ihzns_solicitud.descripcion, ihzns_solicitud.fecha, ihzns_solicitud.id_solicitud, ihzns_solicitud.estado FROM ihzns_solicitud WHERE (ihzns_solicitud.estado = 0);

-- ----------------------------
-- View structure for solicitudes_negocio_sin_procesar_distint
-- ----------------------------
CREATE OR REPLACE VIEW "public"."solicitudes_negocio_sin_procesar_distint" AS 
SELECT DISTINCT ihzns_solicitud.id_usuario FROM ihzns_solicitud WHERE (ihzns_solicitud.estado = 0);

-- ----------------------------
-- View structure for view_consultor
-- ----------------------------
CREATE OR REPLACE VIEW "public"."view_consultor" AS 
SELECT ihzns_users.id, ihzns_users.username FROM (ihzns_users JOIN ihzns_user_usergroup_map ON ((ihzns_user_usergroup_map.user_id = ihzns_users.id))) WHERE (ihzns_user_usergroup_map.group_id = 15);

-- ----------------------------
-- View structure for view_roles
-- ----------------------------
CREATE OR REPLACE VIEW "public"."view_roles" AS 
SELECT ihzns_usergroups.id, ihzns_usergroups.title FROM ihzns_usergroups WHERE ((ihzns_usergroups.id <> 7) AND (ihzns_usergroups.id <> 8));

-- ----------------------------
-- View structure for view_user_bussines
-- ----------------------------
CREATE OR REPLACE VIEW "public"."view_user_bussines" AS 
SELECT ihzns_recursos_humanos.id_user, ihzns_users.username FROM (ihzns_recursos_humanos JOIN ihzns_users ON ((ihzns_users.id = ihzns_recursos_humanos.id_user)));

