INSERT INTO "public"."ihzns_categories" VALUES ('20', '45', '19', '11', '36', '3', 'sample-data-articles/joomla/extensions', 'com_content', 'Extensions', 'extensions', '', '<p>The Joomla! content management system lets you create webpages of various types using extensions. There are 5 basic types of extensions: components, modules, templates, languages, and plugins. Your website includes the extensions you need to create a basic website in English, but thousands of additional extensions of all types are available. The <a href="http://extensions.joomla.org" style="color: #1b57b1; text-decoration: none; font-weight: normal;">Joomla! Extensions Directory</a> is the largest directory of Joomla extensions.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('21', '46', '20', '12', '13', '4', 'sample-data-articles/joomla/extensions/components', 'com_content', 'Components', 'components', '', '<p>Components are larger extensions that produce the major content for your site. Each component has one or more "views" that control how content is displayed. In the Joomla administrator there are additional extensions such as Menus, Redirection, and the extension managers.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '123', '2012-09-25 06:33:59', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('22', '47', '20', '14', '25', '4', 'sample-data-articles/joomla/extensions/modules', 'com_content', 'Modules', 'modules', '', '<p>Modules are small blocks of content that can be displayed in positions on a web page. The menus on this site are displayed in modules. The core of Joomla! includes 24 separate modules ranging from login to search to random images. Each module has a name that starts mod_ but when it displays it has a title. In the descriptions in this section, the titles are the same as the names.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '123', '2012-09-25 06:34:18', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('23', '48', '20', '26', '31', '4', 'sample-data-articles/joomla/extensions/templates', 'com_content', 'Templates', 'templates', '', '<p>Templates give your site its look and feel. They determine layout, colours, typefaces, graphics and other aspects of design that make your site unique. Your installation of Joomla comes prepackaged with three front end templates and two backend templates. <a href="https://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help31:Extensions_Template_Manager_Templates">Help</a></p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '123', '2012-09-25 06:36:13', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('24', '49', '20', '32', '33', '4', 'sample-data-articles/joomla/extensions/languages', 'com_content', 'Languages', 'languages', '', '<p>Joomla! installs in English, but translations of the interfaces, sample data and help screens are available in dozens of languages. <a href="https://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help31:Extensions_Language_Manager_Installed">Help</a></p><p><a href="http://community.joomla.org/translations.html">Translation information</a></p><p>If there is no language pack available for your language, instructions are available for creating your own translation, which you can also contribute to the community by starting a translation team to create an accredited translation.</p><p>Translations of the interfaces are installed using the extensions manager in the site administrator and then managed using the language manager.</p><p>If you have two or more languages installed you may enable the language switcher plugin and module. They should always be used together. If you create multilingual content and mark your content, menu items or modules as being in specific languages and follow <a href="https://docs.joomla.org/Language_Switcher_Tutorial">the complete instructions</a> your users will be able to select a specific content language using the module. By default both the plugin and module are disabled.</p><p>Joomla 2.5 installs with a language override manager that allows you to change the specific words (such as Edit or Search) used in the Joomla application.</p><p>There are a number of extensions that can help you manage translations of content available in the<a href="http://extensions.joomla.org"> Joomla! Extensions Directory</a>.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '123', '2012-09-25 06:37:26', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('25', '50', '20', '34', '35', '4', 'sample-data-articles/joomla/extensions/plugins', 'com_content', 'Plugins', 'plugins', '', '<p>Plugins are small task oriented extensions that enhance the Joomla! framework. Some are associated with particular extensions and others, such as editors, are used across all of Joomla. Most beginning users do not need to change any of the plugins that install with Joomla. <a href="https://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help31:Extensions_Plugin_Manager_Edit">Help</a></p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '123', '2012-09-25 06:36:50', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('26', '51', '14', '38', '47', '2', 'sample-data-articles/park-site', 'com_content', 'Park Site', 'park-site', '', '', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', 'en-GB', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('27', '52', '26', '39', '40', '3', 'sample-data-articles/park-site/park-blog', 'com_content', 'Park Blog', 'park-blog', '', '<p><span style="font-size: 12px;">Here is where I will blog all about the parks of Australia.</span></p><p><em>You can make a blog on your website by creating a category to write your blog posts in (this one is called Park Blog). Each blog post will be an article in that category. If you make a category blog menu link with 1 column it will look like this page, if you display the category description then this part is displayed. </em></p><p><em>To enhance your blog you may want to add extensions for <a href="http://extensions.joomla.org/extensions/contacts-and-feedback/articles-comments" style="color: #1b57b1; text-decoration: none; font-weight: normal;">comments</a>,<a href="http://extensions.joomla.org/extensions/social-web" style="color: #1b57b1; text-decoration: none; font-weight: normal;"> interacting with social network sites</a>, <a href="http://extensions.joomla.org/extensions/content-sharing" style="color: #1b57b1; text-decoration: none; font-weight: normal;">tagging</a>, and <a href="http://extensions.joomla.org/extensions/content-sharing" style="color: #1b57b1; text-decoration: none; font-weight: normal;">keeping in contact with your readers</a>. You can also enable the syndication that is included in Joomla (in the Integration Options set Show Feed Link to Show and make sure to display the syndication module on the page).</em></p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":"images\/sampledata\/parks\/banner_cradle.jpg"}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', 'en-GB', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('28', '53', '26', '41', '46', '3', 'sample-data-articles/park-site/photo-gallery', 'com_content', 'Photo Gallery', 'photo-gallery', '', '<p>These are my photos from parks I have visited (I didn''t take them, they are all from <a href="http://commons.wikimedia.org/wiki/Main_Page">Wikimedia Commons</a>).</p><p><em>This shows you how to make a simple image gallery using articles in com_content. </em></p><p><em>In each article put a thumbnail image before a "readmore" and the full size image after it. Set the article to Show Intro Text: Hide. </em></p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '123', '2012-09-25 11:05:37', '0', 'en-GB', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('29', '54', '14', '48', '53', '2', 'sample-data-articles/fruit-shop-site', 'com_content', 'Fruit Shop Site', 'fruit-shop-site', '', '', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('30', '55', '29', '49', '50', '3', 'sample-data-articles/fruit-shop-site/growers', 'com_content', 'Growers', 'growers', '', '<p>We search the whole countryside for the best fruit growers.</p><p><em>You can let each supplier have a page that he or she can edit. To see this in action you will need to create a user who is in the suppliers group.  </em></p><p><em>Create one page in the growers category for that user and make that supplier the author of the page. That user will be able to edit his or her page. </em></p><p><em>This illustrates the use of the Edit Own permission. </em></p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('34', '59', '16', '62', '63', '2', 'sample-data-contact/park-site', 'com_contact', 'Park Site', 'park-site', '', '', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', 'en-GB', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('35', '60', '16', '64', '121', '2', 'sample-data-contact/shop-site', 'com_contact', 'Shop Site', 'shop-site', '', '', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('36', '61', '35', '65', '66', '3', 'sample-data-contact/shop-site/staff', 'com_contact', 'Staff', 'staff', '', '<p>Please feel free to contact our staff at any time should you need assistance.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('37', '62', '35', '67', '120', '3', 'sample-data-contact/shop-site/fruit-encyclopedia', 'com_contact', 'Fruit Encyclopedia', 'fruit-encyclopedia', '', '<p> </p><p>Our directory of information about different kinds of fruit.</p><p>We love fruit and want the world to know more about all of its many varieties.</p><p>Although it is small now, we work on it whenever we have a chance.</p><p>All of the images can be found in <a href="http://commons.wikimedia.org/wiki/Main_Page">Wikimedia Commons</a>.</p><p><img src="images/sampledata/fruitshop/apple.jpg" border="0" alt="Apples" title="Apples" /></p><p><em>This encyclopedia is implemented using the contact component, each fruit a separate contact and a category for each letter. A CSS style is used to create the horizontal layout of the alphabet headings. </em></p><p><em>If you wanted to, you could allow some users (such as your growers) to have access to just this category in the contact component and let them help you to create new content for the encyclopedia.</em></p><p> </p>', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
