INSERT INTO "public"."ihzns_categories" VALUES ('64', '93', '22', '15', '16', '5', 'sample-data-articles/joomla/extensions/modules/articles-modules', 'com_content', 'Content Modules', 'articles-modules', '', '<p>Content modules display article and other information from the content component.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('65', '94', '22', '17', '18', '5', 'sample-data-articles/joomla/extensions/modules/user-modules', 'com_content', 'User Modules', 'user-modules', '', '<p>User modules interact with the user system, allowing users to login, show who is logged-in, and showing the most recently registered users.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('66', '95', '22', '19', '20', '5', 'sample-data-articles/joomla/extensions/modules/display-modules', 'com_content', 'Display Modules', 'display-modules', '', '<p>These modules display information from components other than content and user. These include news feeds and the media manager.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('67', '96', '22', '21', '22', '5', 'sample-data-articles/joomla/extensions/modules/utility-modules', 'com_content', 'Utility Modules', 'utility-modules', '', '<p>Utility modules provide useful functionality such as search, syndication and statistics.</p>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '0', '1970-01-01 00:00:00', '0', '*', '1');
INSERT INTO "public"."ihzns_categories" VALUES ('69', '98', '23', '27', '28', '5', 'sample-data-articles/joomla/extensions/templates/beez3', 'com_content', 'Beez3', 'beez3', '', '<p>Beez3 is a versatile, easy to customise template that works for a variety of sites. It meets major accessibility standards and demonstrates a range of css and javascript techniques.</p><ul><li><a href="index.php?Itemid=424">Home Page</a></li><li><a href="index.php?Itemid=423">Typography</a></li></ul>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2011-01-01 00:00:01', '123', '2012-09-25 11:47:38', '0', '*', '1');
