INSERT INTO "public"."ihzns_categories" VALUES ('78', '174', '23', '29', '30', '5', 'sample-data-articles/joomla/extensions/templates/protostar', 'com_content', 'Protostar', 'protostar', '', '<p>Protostar is a mobile ready template designed using Twitter Bootstrap. It is sleek and easily to customise. It is the default template for Joomla 3.</p><ul><li><a href="index.php?Itemid=469">Home Page</a></li><li><a href="index.php?option=com_content&amp;view=article&amp;id=49&amp;catid=23&amp;Itemid=470">Typography</a></li></ul>', '1', '0', '1970-01-01 00:00:00', '1', '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', '304', '2012-09-25 11:50:03', '123', '2012-09-25 12:13:14', '0', '*', '1');
